import React from 'react';
import classes from './MealItemFrom.module.css';
import Input from '../../UI/Input';

const MealItemForm = () => {
    return (
        <form className={classes.form}>
            <Input label="Amount" input={{
                id: 'amount',
                type: 'number',
                min: 1,
                max: 5,
                step: 1,
                defaultVal: 1
            }} />
            <button> + Add </button>
        </form>
    )
}

export default MealItemForm
